	override fun sempred(_localctx: RuleContext?, ruleIndex: Int, predIndex: Int) : Boolean {
		when (ruleIndex) {
		0 -> return RegularExpressionLiteral_sempred(_localctx as RuleContext, predIndex)
		54 -> return OctalIntegerLiteral_sempred(_localctx as RuleContext, predIndex)
		88 -> return Implements_sempred(_localctx as RuleContext, predIndex)
		89 -> return Let_sempred(_localctx as RuleContext, predIndex)
		90 -> return Private_sempred(_localctx as RuleContext, predIndex)
		91 -> return Public_sempred(_localctx as RuleContext, predIndex)
		92 -> return Interface_sempred(_localctx as RuleContext, predIndex)
		93 -> return Package_sempred(_localctx as RuleContext, predIndex)
		94 -> return Protected_sempred(_localctx as RuleContext, predIndex)
		95 -> return Static_sempred(_localctx as RuleContext, predIndex)
		96 -> return Yield_sempred(_localctx as RuleContext, predIndex)
		}
		return true
	}
	private fun RegularExpressionLiteral_sempred( _localctx : RuleContext, predIndex: Int) : Boolean {
		when (predIndex) {
		    0 -> return isRegexPossible()
		}
		return true
	}
	private fun OctalIntegerLiteral_sempred( _localctx : RuleContext, predIndex: Int) : Boolean {
		when (predIndex) {
		    1 -> return !strictMode
		}
		return true
	}
	private fun Implements_sempred( _localctx : RuleContext, predIndex: Int) : Boolean {
		when (predIndex) {
		    2 -> return strictMode
		}
		return true
	}
	private fun Let_sempred( _localctx : RuleContext, predIndex: Int) : Boolean {
		when (predIndex) {
		    3 -> return strictMode
		}
		return true
	}
	private fun Private_sempred( _localctx : RuleContext, predIndex: Int) : Boolean {
		when (predIndex) {
		    4 -> return strictMode
		}
		return true
	}
	private fun Public_sempred( _localctx : RuleContext, predIndex: Int) : Boolean {
		when (predIndex) {
		    5 -> return strictMode
		}
		return true
	}
	private fun Interface_sempred( _localctx : RuleContext, predIndex: Int) : Boolean {
